【商品説明】<br>好評の「極潤」シリーズから肌をすこやかに整える薬用化粧水を出すことで、市場を拡大していきます。成分だけでなく使用感、肌仕上がりにまでこだわった処方です。<br>商品サイズ：45×160×45<BR><br>JANコード：4987241138999<BR>cs：48<BR><p>「肌研 極潤 薬用スキンコンディショナー 170ml」は、和漢植物(ハトムギ・ドクダミ)に着目し、ニキビ・肌荒れなどのトラブルを防ぎ、うるおいも与える薬用保湿化粧水です。ニキビや肌荒れを防ぐグリチルリチン酸ジカリウム、イプシロン-アミノカプロン酸(抗炎症成分)配合。また、うるおい成分のハトムギエキスを配合。お肌にすーっとなじんでうるおいを与え、コンディションを整えて、すこやかな透明感のある肌に導きます。健康な素肌と同じ弱酸性。お肌への優しさに配慮し、無香料・無着色・鉱物油フリーです。医薬部外品。(R)肌研、(R)ハラダボ、(R)極潤<br><br>使用方法<br><br>洗顔後、手のひらに適量をとり、肌になじませるようやさしくパッティングしてしみこませてください。<br><br>※極潤(ゴクジュン)シリーズでのご使用がおすすめです。<br><br>ご注意<br><br>○傷、はれもの、湿疹、かぶれ等異常のある時は使用しないこと。<br>○肌に異常が生じていないかよく注意して使用すること。使用中、又は使用後日光にあたって、赤み、はれ、かゆみ、刺激、色抜け(白班等)や黒ずみ等の異常があらわれた場合は使用を中止し、皮フ科専門医等へ相談すること。そのまま使用を続けると症状が悪化することがある。<br>○目に入らないよう注意し、入った時はすぐに水又はぬるま湯で洗い流すこと。なお、異常が残る場合は眼科医に相談すること。<br>○使用後は必ずキャップをしめて、なるべく早く使用すること。<br>○高温又は低温の場所、直射日光を避け、保管すること。<br>○乳幼児の手の届かないところに保管すること。<br>○衣服等につかないよう注意すること。(材質によっては落ちにくいことがある)<br><br>成分<br><br>【有効成分】<br>グリチルリチン酸ジカリウム、イプシロン-アミノカプロン酸<br>【その他成分】<br>ヨクイニンエキス(ハトムギエキス)、ドクダミエキス、カモミラエキス(1)、ヒアルロン酸Na-2、スクワラン、dl-カンフル、BG、トリ2-エチルヘキサン酸グリセリル、l-メントール、POE硬化ヒマシ油、セスキオレイン酸ソルビタン、EDTA-2Na、無水エタノール、エタノール<br><br>原産国<br><br>日本<br><br>お問い合わせ先<br><br>ロート製薬株式会社<br>大阪市生野区巽西1-8-1<br>TEL：06-6758-1272<br></p><p>（ロート製薬　ハダラボ　はだらぼ　hadarabo　日焼け止め　肌研　UVケア　UVジェル　紫外線対策　春　夏　パーフェクトゲル　極潤　ごくじゅん　潤い　スキンケア　オールインワン　ＲＯＨＴＯ　スキンケア　肌ケア　お肌　美容　コスメ　ビューティー　化粧品　美顔　お肌の手入れ）<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
